import React from 'react';
import { useNavigate } from 'react-router-dom';

const ProgramLanding = () => {
  const navigate = useNavigate();

  const handleApplyNow = () => {
    navigate('/courses');
  };

  const handleDownloadBrochure = () => {
    // Placeholder for download functionality
    alert('Brochure download feature coming soon!');
  };

  return (
    <div className="program-landing-page" style={{ 
      minHeight: '100vh', 
      backgroundColor: '#ffffff',
      fontFamily: 'Arial, sans-serif'
    }}>
      {/* White Header Bar with Logo */}
      <div style={{
        backgroundColor: '#ffffff',
        padding: '15px 20px',
        borderBottom: '1px solid #e9ecef'
      }}>
        <div className="container-fluid">
          <div className="d-flex align-items-center">
            <div style={{
              fontSize: '18px',
              fontWeight: '700',
              letterSpacing: '0.5px',
              color: '#1a531a'
            }}>
              IMARTICUS LEARNING
            </div>
            <div style={{
              fontSize: '12px',
              marginLeft: '10px',
              color: '#666666',
              fontWeight: '500'
            }}>
              12 YEARS
            </div>
          </div>
        </div>
      </div>

      {/* Dark Green Navigation Bar */}
      <div style={{
        backgroundColor: '#1a531a',
        color: '#ffffff',
        padding: '0'
      }}>
        <div className="container-fluid" style={{ padding: '12px 20px' }}>
          <nav style={{ 
            display: 'flex', 
            gap: '20px', 
            alignItems: 'center',
            flexWrap: 'wrap',
            justifyContent: 'center'
          }}>
            {['Overview', 'Hiring Partners', 'Curriculum', 'Trainers', 'Projects', 'Success stories', 'Pricing', 'FAQs'].map((item, index) => (
              <a
                key={index}
                href="#"
                onClick={(e) => e.preventDefault()}
                style={{
                  color: '#ffffff',
                  textDecoration: 'none',
                  fontSize: '13px',
                  fontWeight: index === 0 ? '600' : '400',
                  paddingBottom: '8px',
                  borderBottom: index === 0 ? '3px solid #FF6B35' : 'none',
                  transition: 'all 0.2s ease',
                  whiteSpace: 'nowrap'
                }}
                onMouseEnter={(e) => {
                  if (index !== 0) {
                    e.currentTarget.style.opacity = '0.8';
                  }
                }}
                onMouseLeave={(e) => {
                  if (index !== 0) {
                    e.currentTarget.style.opacity = '1';
                  }
                }}
              >
                {item}
              </a>
            ))}
          </nav>
        </div>
      </div>

      {/* Main Content */}
      <div style={{ padding: '60px 0', backgroundColor: '#ffffff' }}>
        <div className="container" style={{ maxWidth: '1200px' }}>
          {/* MyCaptain Logo */}
          <div className="text-center mb-4">
            <div style={{
              display: 'inline-flex',
              alignItems: 'center',
              gap: '10px',
              marginBottom: '8px'
            }}>
              <div style={{
                width: '40px',
                height: '40px',
                backgroundColor: '#FF6B35',
                borderRadius: '50%',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                fontSize: '24px'
              }}>
                ‚úã
              </div>
              <div style={{
                fontSize: '32px',
                fontWeight: '700',
                color: '#FF6B35',
                letterSpacing: '-1px'
              }}>
                mycaptain
              </div>
            </div>
            <div style={{
              fontSize: '12px',
              color: '#333333',
              fontWeight: '500',
              letterSpacing: '1px'
            }}>
              BY IMARTICUS LEARNING
            </div>
          </div>

          {/* Main Heading */}
          <div className="text-center mb-3">
            <h1 style={{
              fontSize: '3.5rem',
              fontWeight: '700',
              color: '#000000',
              marginBottom: '15px',
              lineHeight: '1.1',
              letterSpacing: '-1px'
            }}>
              Become a Digital Marketer in 18 Weeks
            </h1>
            <p style={{
              fontSize: '1.3rem',
              color: '#333333',
              fontWeight: '400',
              marginBottom: '40px'
            }}>
              MyCaptain Digital Marketing Program with Job Assurance
            </p>
          </div>

          {/* Program Details Card */}
          <div className="row justify-content-center mb-5">
            <div className="col-lg-8">
              <div style={{
                backgroundColor: '#ffffff',
                borderRadius: '12px',
                padding: '40px',
                boxShadow: '0 4px 20px rgba(0, 0, 0, 0.08)',
                border: '1px solid #e9ecef'
              }}>
                <div className="row mb-4">
                  <div className="col-md-6 mb-3">
                    <div style={{ fontSize: '14px', color: '#666666', marginBottom: '8px' }}>
                      Next Batch
                    </div>
                    <div style={{ fontSize: '24px', fontWeight: '600', color: '#000000' }}>
                      October
                    </div>
                  </div>
                  <div className="col-md-6 mb-3">
                    <div style={{ fontSize: '14px', color: '#666666', marginBottom: '8px' }}>
                      Available Seats
                    </div>
                    <div style={{ fontSize: '24px', fontWeight: '600', color: '#000000' }}>
                      29/60
                    </div>
                  </div>
                </div>

                <div className="row mb-4">
                  <div className="col-md-6 mb-3">
                    <div style={{ fontSize: '14px', color: '#666666', marginBottom: '8px' }}>
                      Taught by experts from
                    </div>
                    <div style={{ fontSize: '16px', fontWeight: '500', color: '#000000' }}>
                      Rapido, Deloitte, MFine, Zomato
                    </div>
                  </div>
                  <div className="col-md-6 mb-3">
                    <div style={{ fontSize: '14px', color: '#666666', marginBottom: '8px' }}>
                      Designed for
                    </div>
                    <div style={{ fontSize: '16px', fontWeight: '500', color: '#000000' }}>
                      Freshers & Early Working Professionals
                    </div>
                  </div>
                </div>

                {/* Rating and Learners */}
                <div style={{
                  paddingTop: '20px',
                  borderTop: '1px solid #e9ecef',
                  display: 'flex',
                  alignItems: 'center',
                  gap: '30px',
                  flexWrap: 'wrap'
                }}>
                  <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
                    <span style={{ fontSize: '20px', color: '#FFD700' }}>‚≠ê</span>
                    <span style={{ fontSize: '16px', fontWeight: '600', color: '#000000' }}>4.51</span>
                  </div>
                  <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
                    <span style={{ fontSize: '18px' }}>üë§</span>
                    <span style={{ fontSize: '16px', fontWeight: '500', color: '#000000' }}>1.2 Lacs+ Learners</span>
                  </div>
                </div>
              </div>
            </div>
          </div>

          {/* Call to Action Buttons */}
          <div className="text-center">
            <div style={{ display: 'flex', gap: '20px', justifyContent: 'center', flexWrap: 'wrap' }}>
              <button
                onClick={handleApplyNow}
                style={{
                  backgroundColor: '#FF6B35',
                  color: '#ffffff',
                  border: 'none',
                  padding: '20px 80px',
                  borderRadius: '8px',
                  fontSize: '1.2rem',
                  fontWeight: '600',
                  cursor: 'pointer',
                  transition: 'all 0.3s ease',
                  boxShadow: '0 4px 15px rgba(255, 107, 53, 0.3)',
                  letterSpacing: '0.3px',
                  minWidth: '220px',
                  minHeight: '60px'
                }}
                onMouseEnter={(e) => {
                  e.currentTarget.style.backgroundColor = '#e55a2b';
                  e.currentTarget.style.transform = 'translateY(-2px)';
                  e.currentTarget.style.boxShadow = '0 6px 20px rgba(255, 107, 53, 0.4)';
                }}
                onMouseLeave={(e) => {
                  e.currentTarget.style.backgroundColor = '#FF6B35';
                  e.currentTarget.style.transform = 'translateY(0)';
                  e.currentTarget.style.boxShadow = '0 4px 15px rgba(255, 107, 53, 0.3)';
                }}
              >
                Apply Now
              </button>
              <button
                onClick={handleDownloadBrochure}
                style={{
                  backgroundColor: '#1a1a1a',
                  color: '#ffffff',
                  border: 'none',
                  padding: '20px 80px',
                  borderRadius: '8px',
                  fontSize: '1.2rem',
                  fontWeight: '600',
                  cursor: 'pointer',
                  transition: 'all 0.3s ease',
                  boxShadow: '0 4px 15px rgba(26, 26, 26, 0.3)',
                  letterSpacing: '0.3px',
                  minWidth: '220px',
                  minHeight: '60px'
                }}
                onMouseEnter={(e) => {
                  e.currentTarget.style.backgroundColor = '#000000';
                  e.currentTarget.style.transform = 'translateY(-2px)';
                  e.currentTarget.style.boxShadow = '0 6px 20px rgba(26, 26, 26, 0.4)';
                }}
                onMouseLeave={(e) => {
                  e.currentTarget.style.backgroundColor = '#1a1a1a';
                  e.currentTarget.style.transform = 'translateY(0)';
                  e.currentTarget.style.boxShadow = '0 4px 15px rgba(26, 26, 26, 0.3)';
                }}
              >
                Download Brochure
              </button>
            </div>
          </div>
        </div>
      </div>

      {/* Footer */}
      <div style={{
        backgroundColor: '#1a531a',
        height: '40px',
        width: '100%',
        marginTop: '60px'
      }}>
      </div>
    </div>
  );
};

export default ProgramLanding;
